import React from "react";
import HeaderOne from './HeaderOne';
import HeaderTwo from './HeaderTwo';
import HeaderThree from './HeaderThree';
import NewsletterOne from './NewsletterOne';
import BottomFooter from './BottomFooter';
import FooterOne from "./FooterOne";
import ShippingOne from './ShippingOne';
import DeliveryOne from './DeliveryOne';
import TopVendorsOne from './TopVendorsOne';
import RecommendedOne from "./RecommendedOne";
import OfferOne from './OfferOne';
import ProductListOne from "./ProductListOne";


const HomePage = () => {



  return (
    <>
           
      <HeaderOne/>
      <HeaderTwo/>
      <HeaderThree/>
      <ProductListOne/>
      <OfferOne/>
      <RecommendedOne/>
      <TopVendorsOne/>
      <DeliveryOne/>
      <ShippingOne/>
      <NewsletterOne/>
      <FooterOne/>
      <BottomFooter/>
    </>
  );
};

export default HomePage;
